import React from "react";
import Tile from '../tile/Tile'; 

export const TileList = ({ items }) => {
  return (
    <div className="tile-list">
      {items?.map((item, index) => (
        <Tile key={index} name={item.name} {...item} />
      ))}
    </div>
  );
};
